window.bookSummaryJSON = "<p>The Sword of Light, the only weapon capable of killing Queen Aneira, has been found. Ember’s destiny is to end her reign and become the new queen. Or so she thought.</p> <p>When Eli and Ember are taken by Aneira, she is forced to make a deal to save the man she loves. A curse is placed on Ember that if she uses the sword against the Seelie Queen, Eli dies. A price she might not be willing to make. The fight for Earth is on, and old enemies must work together to stop Aneira from bringing down the wall between Earth and the Otherworld, making humans servants to the fae and killing all those who oppose her reign.</p> <p>When deep secrets are revealed, Ember’s world and heart are ripped apart even more. Ember must go beyond anything she could ever imagine, making the ultimate sacrifice to save millions of innocent lives. Not all fairy tales have a happy ending….</p>"; 
